import { useEffect } from "react";

const objCountUseOneFeffect : IObjCountUseOneFeffect= {}

export default function useOneEffect(id:string,call:()=>void){
    let count =0;
    useEffect(()=>{
        if(count++==0)
            call();
    })

}

interface IObjCountUseOneFeffect{
    [key :string]  : number;
}
